import axios from 'axios';
const API_URL = 'http://localhost:8000';

export default class PostService{

    constructor(){}

    getPosts(type) {
        const url = `${API_URL}/api/${type}/`;
        return axios.get(url).then(response => response.data);
    }

    getCustomer(type, pk) {
        const url = `${API_URL}/api/${type}/${pk}`;
        return axios.get(url).then(response => response.data);
    }
}
